"use client";

import Image from "next/image";
import { use, useEffect, useState } from "react";
import { getArticleById } from "@/app/actions/article";
import "quill/dist/quill.core.css";
import "quill/dist/quill.snow.css";

export interface Article {
  title: string;
  image: string | null;
  description: string;
  content: string;
  createdAt: Date;
  updatedAt: Date;
}

export default function ArticleById({
  params,
}: {
  params: Promise<{ id: string }>;
}) {
  const [article, setArticle] = useState<Article | null>(null);
  const [loading, setLoading] = useState(true);
  const id = use<{ id: string }>(params).id;

  useEffect(() => {
    const loadArticle = async () => {
      try {
        const data = await getArticleById(parseInt(id, 10));
        if (data?.success && data.article) {
          setArticle(data.article);
        }
      } catch (error) {
        console.error("Failed to load article:", error);
      } finally {
        setLoading(false);
      }
    };
    loadArticle();
  }, [id]);

  const shareUrl = typeof window !== "undefined" ? window.location.href : "";

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="text-2xl">Loading...</div>
      </div>
    );
  }

  if (!article) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="text-2xl">Article not found</div>
      </div>
    );
  }

  const shareTo = (platform: "line" | "facebook" | "x") => {
    let url = "";

    switch (platform) {
      case "line":
        url = `https://social-plugins.line.me/lineit/share?url=${encodeURIComponent(
          shareUrl,
        )}`;
        break;
      case "facebook":
        url = `https://www.facebook.com/sharer/sharer.php?u=${encodeURIComponent(
          shareUrl,
        )}`;
        break;
      case "x":
        url = `https://twitter.com/intent/tweet?url=${encodeURIComponent(
          shareUrl,
        )}`;
        break;
    }

    window.open(url, "_blank", "noopener,noreferrer");
  };

  console.log(article.content);

  return (
    <div className="flex flex-col gap-10 bg-white min-h-screen">
      <div className="flex lg:flex-row flex-col pt-31 px-15 gap-10">
        <div className="flex relative h-[30vh] lg:w-154.75 lg:h-115.25 border-10 rounded-[40px] border-[#95E999] overflow-hidden items-center justify-center">
          {article.image ? (
            <Image
              src={article.image}
              alt={article.title}
              fill
              className="object-cover"
              priority
            />
          ) : (
            <svg
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
              className="w-100"
            >
              <path d="M7.828 5l-1-1H22v15.172l-1-1v-.69l-3.116-3.117-.395.296-.714-.714.854-.64a.503.503 0 0 1 .657.046L21 16.067V5zM3 20v-.519l2.947-2.947a1.506 1.506 0 0 0 .677.163 1.403 1.403 0 0 0 .997-.415l2.916-2.916-.706-.707-2.916 2.916a.474.474 0 0 1-.678-.048.503.503 0 0 0-.704.007L3 18.067V5.828l-1-1V21h16.172l-1-1zM17 8.5A1.5 1.5 0 1 1 15.5 7 1.5 1.5 0 0 1 17 8.5zm-1 0a.5.5 0 1 0-.5.5.5.5 0 0 0 .5-.5zm5.646 13.854l.707-.707-20-20-.707.707z" />
              <path fill="none" d="M0 0h24v24H0z" />
            </svg>
          )}
        </div>

        <div className="flex flex-col gap-6">
          <div className="font-bold text-4xl text-[#00000099]">HR Insight</div>
          {/* title */}
          <div className="font-bold text-7xl text-[#95E999]">
            {article.title}
          </div>
          {/* updated at ... */}
          <div className="flex items-center gap-2">
            <svg
              width="35"
              height="35"
              viewBox="0 0 35 35"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
            >
              <rect
                opacity="0.8"
                width="35"
                height="35"
                fill="url(#pattern0_363_1241)"
              />
              <defs>
                <pattern
                  id="pattern0_363_1241"
                  patternContentUnits="objectBoundingBox"
                  width="1"
                  height="1"
                >
                  <use href="#image0_363_1241" transform="scale(0.00195312)" />
                </pattern>
                <image
                  id="image0_363_1241"
                  width="512"
                  height="512"
                  preserveAspectRatio="none"
                  href="data:image/png;base64,"
                />
              </defs>
            </svg>
            <div className="text-2xl text-black">
              {new Date(article.updatedAt).toLocaleDateString()}
            </div>
          </div>
          {/* description */}
          <div className="text-lg text-gray-600 italic border-t border-b py-4">
            {article.description}
          </div>

          {/* share to ... */}
          <div className="flex gap-3 items-center">
            <div className="text-2xl text-black">แชร์ไปยัง</div>
            {/* LINE */}
            <button
              type="button"
              onClick={() => shareTo("line")}
              className="cursor-pointer"
              aria-label="Share to LINE"
            >
              {/* icon line */}
              <svg
                width="50"
                height="50"
                viewBox="0 0 50 50"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <rect width="50" height="50" fill="url(#pattern0_363_1245)" />
                <defs>
                  <pattern
                    id="pattern0_363_1245"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use
                      href="#image0_363_1245"
                      transform="scale(0.00195312)"
                    />
                  </pattern>
                  <image
                    id="image0_363_1245"
                    width="512"
                    height="512"
                    preserveAspectRatio="none"
                    href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>

            {/* Facebook */}
            <button
              onClick={() => shareTo("facebook")}
              className="cursor-pointer"
              aria-label="Share to Facebook"
            >
              {/* icon facebook */}
              <svg
                width="50"
                height="50"
                viewBox="0 0 50 50"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <rect width="50" height="50" fill="url(#pattern0_363_1248)" />
                <defs>
                  <pattern
                    id="pattern0_363_1248"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use
                      href="#image0_363_1248"
                      transform="scale(0.00195312)"
                    />
                  </pattern>
                  <image
                    id="image0_363_1248"
                    width="512"
                    height="512"
                    preserveAspectRatio="none"
                    href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>

            {/* X (Twitter) */}
            <button
              onClick={() => shareTo("x")}
              className="cursor-pointer"
              aria-label="Share to X"
            >
              {/* icon x */}
              <svg
                width="50"
                height="50"
                viewBox="0 0 50 50"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <rect width="50" height="50" fill="url(#pattern0_363_1251)" />
                <defs>
                  <pattern
                    id="pattern0_363_1251"
                    patternContentUnits="objectBoundingBox"
                    width="1"
                    height="1"
                  >
                    <use
                      href="#image0_363_1251"
                      transform="scale(0.00195312)"
                    />
                  </pattern>
                  <image
                    id="image0_363_1251"
                    width="512"
                    height="512"
                    preserveAspectRatio="none"
                    href="data:image/png;base64,"
                  />
                </defs>
              </svg>
            </button>
          </div>
        </div>
      </div>

      <div className="flex flex-col gap-6 px-15 pb-20">
        <div
          className="ql-editor max-w-none text-gray-800 p-0 text-lg lg:text-2xl"
          dangerouslySetInnerHTML={{ __html: article.content }}
        />
      </div>
    </div>
  );
}
